import React, { Component } from 'react'

class Head extends Component {

    render() {
        const Head = {
            position: 'relative',
            backgroundColor: '#2dcf91',
            border: '3px solid blue',
            minHeight: '150px',
            backgroundImage: 'linear-gradient(#2dcf91 10%, 30%, #000000 50%)'
        };

        return (
            <div style = { Head }>

            </div>
        )
    }
}

export default Head;
